description:
I invite all of you to join Antalya Real Flight event organized by Aerosoft &amp; IVAO 
Turkey  on 17th November (Staurday) in a group flight.

We will be departing VIDP, New Delhi with AIR INDIA CALLSIGNS @ 1200Z so that we reach Antalya (LTAI) by 17:30 to 1800Z. I have mailed Turkey division regarding this.

MAIN ROUTE :

BUTOP M875 DI N644 KENAL B441 SBZ A416 NSR G781 ZAJ UL124 BAYIR UW73 DYB UW716 GAZ UW74 MUT UR55 ADBEL

FMC ROUTE (Waypoint to Waypoint, for use with FSBuild or other flight planning tools)

BUTOP GUGAL NIKET JHANG DI PARAK PAVLO MESRA PATOX NEVIV VUVEN LEMOD KENAL REJEP MARAD OTRUZ ALMUX MSD METKI SBZ VATAR IBRAV MITOT PUSAL DNZ MODEK IMKER NSR LABKA ZAJ TOTBO UMH TUDNU BONAM ZELSU VAN BEYAZ BAYIR BALIM EKMIN TAMER DYB DEMEB GAP LUTAM GAZ MILBA ADA MANAZ MUT KETEK ADBEL

